syntax = "proto3";

package make87_messages_ros2.jazzy.ublox_msgs.msg;


message CfgNMEA7 {
     uint32 filter = 1;
     uint32 nmea_version = 2;
     uint32 num_sv = 3;
     uint32 flags = 4;
     uint32 gnss_to_filter = 5;
     uint32 sv_numbering = 6;
     uint32 main_talker_id = 7;
     uint32 gsv_talker_id = 8;
     uint32 reserved = 9;
}
